Параметры:
*1  = основа без последней буквы
*3  = буква в конце основы (n или l)
*2  = произнош. основы (до изменяющегося звука)
*IPA1l = произнош. изменяющегося звука перед 'a' с долгой гласной
*IPA1s = произнош. изменяющегося звука перед 'a' с краткой гласной
