 '{{docpage}}
==Назначение==
Это шаблон предназначен для задания нерегулярного спряжения немецких глаголов.

==Использование==
{{спряжение de}}
<code>&#123;&#123;гл de irreg<br/>
|ich=<br/>
|du=<br/>
|er=<br/>
|wir=<br/>
|ihr=<br/>
|sie=<br/>
|prät=<br/>
|perf2=<br/>
|kond2=<br/>
|imper-sg=<br/>
|imper-pl=<br/>
|hilf=<br/>
|слоги={{по-слогам|?}}<br/>
&#125;&#125;</code>

Параметры:
* формы [[настоящее время|настоящего времени]] [[изъявительное наклонение|изъявительного наклонения]] ([[Indicativ]] [[Präsens]]):
** <code>''ich''</code> — форма единственного числа первого лица;
** <code>''du''</code> — форма единственного числа второго лица;
** <code>''er''</code> — форма единственного числа третьего лица;
** <code>''wir''</code> — форма множественного числа первого лица;
** <code>''ihr''</code> — форма множественного числа второго лица;
** <code>''sie''</code> — форма множественного числа третьего лица;
* <code>''prät''</code> — форма несовершенного ([[Imperfekt]]) [[прошедшее время|прошедшего времени]] изъявительного наклонения единственного числа первого лица (Indicativ [[Präteritum]]);
* <code>''perf2''</code> — форма [[причастие|причастия]] прошедшего времени ([[Partizip]] II);
* формы [[повелительное наклонение|повелительного наклонения]] ([[Imperativ]]):
** <code>''imper-sg''</code> — форма единственного числа второго лица;
** <code>''imper-pl''</code> — форма множественного числа и третьего лица единственного числа;
* <code>''kond2''</code> —  форма несовершенного (Imperfekt) прошедшего времени [[сослагательное наклонение|сослагательного наклонения]] единственного числа первого лица ([[Konjunktiv]] Präteritum);
* <code>''hilf''</code> — вспомогательный глагол ([[haben]] или [[sein]]) для образования формы совершенного прошедшего времени ([[Perfekt]]) и предпрошедшего времени ([[Plusquamperfekt]]).

